import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import MainPage from './pages/main.js';
import { Routes, Route } from 'react-router-dom';

function App() {
	return (
		<Routes>
			<Route path="/">
			<div className="main">
				<MainPage />
			</div>
			</Route>
		</Routes>
	);
}

export default App;
